import React from "react";

const Category = () => {
  return (
    <React.Fragment>
      <Sns
        onClick={() => {
          history.push("/post");
        }}
      >
        SNS
      </Sns>
      <Board
        onClick={() => {
          history.push("/board");
        }}
      >
        게시판
      </Board>
    </React.Fragment>
  );
};

export default Category;

const Sns = styled.a`
  cursor: pointer;
  color: #2b61e1;
  margin-right: 4rem;
  opacity: 0.7;

  :hover {
    opacity: 1;
  }
`;

const Board = styled.a`
  cursor: pointer;

  color: #2b61e1;
  opacity: 0.7;

  :hover {
    opacity: 1;
  }
`;
